import React from "react";

function Common() {
  return (
    <>
      <div className="hometext">
        <h1>welcome to home page</h1>
        <h1>
          start your buiness with
          <span style={{ color: "blue" }}> vatsal patel</span>
        </h1>
        <NavLink to="/service">
          <button className="btn">get started</button>
        </NavLink>
        <img id="img1" src={img} />
      </div>
    </>
  );
}

export default Common;
